import axios from "axios";
import React, { useState, useEffect } from "react";

const StudentProfile = (props) => {
  const [isLoading, SetisLoading] = useState(false);
  useEffect(() => {
    SetisLoading(true);
    axios
      .get(
        `http://localhost:8080/Student/getStudent?username=moe`,
        {
          headers: {
            'Content-Type': `application/json`,
            'Accept': `*/*`,
            'Authorization': `Bearer eyJhbGciOiJIUzI1NiJ9.eyJzdWIiOiJBRE1JTiIsImlhdCI6MTYyMTA3MDg1NywiZXhwIjoxNjIxMDc4MDU3fQ.o72GJMXhstydnzhplJd3b7gNCP6Ng75juhwa5h4Z-8A`,
          },
        }
      )
      .then((res) => {
        SetisLoading(false);
        console.log(res.data);
      })
      .catch((error) => {
        SetisLoading(false);
        console.log(error);
      });
  }, []);

  return (
    <div>
      Student profile
      {isLoading && <p>Obtaining data...</p>}
    </div>
  );
};

export default StudentProfile;
